fore Title'=>'Biểu tượng trước tiêu đề','Icon Color'=>'Màu biểu tượng','Icon Indicator'=>'Biểu tượng chỉ báo','Icon Library'=>'Thư viện biểu tượng','Icon Settings'=>'Cài đặt biểu tượng','Icon/class name....'=>'Biểu tượng/tên lớp....','id-badge'=>'huy hiệu id','id-card'=>'thẻ căn cước','id-card-alt'=>'id-card-alt','If the icons are not working and you want to disable Font Awesome loading from the plugin, select Yes.'=>'Nếu các biểu tượng không hoạt động và bạn muốn tắt tính năng tải Font Awesome từ plugin, hãy chọn Có.','If the icons are not working, and you want to remove Flat Icon load from the plugin, select "Yes."'=>'Nếu các biểu tượng không hoạt động và bạn muốn xóa tính năng Flat Icon load khỏi plugin, hãy chọn "Có".','If you enable this then a Widget area will be registred and you can add any widgets from the Widget Menu. By default its disabled'=>'Nếu bạn bật tính năng này thì một vùng Widget sẽ được đăng ký và bạn có thể thêm bất kỳ Widget nào từ Menu Widget. Theo mặc định, nó bị vô hiệu hóa','If you encounter a Fatal Error message on the event details page, you can enable this patch and check if the error persists. However, if there is no error, we recommend keeping the patch disabled'=>'Nếu bạn gặp thông báo Lỗi nghiêm trọng trên trang chi tiết sự kiện, bạn có thể bật bản vá này và kiểm tra xem lỗi có còn tiếp diễn không. Tuy nhiên, nếu không có lỗi, chúng tôi khuyên bạn nên tắt bản vá','If you encounter the message "Sorry, There Are No Seats Available" after updating to version 4.3.0 or later, you may enable this setting. Otherwise, please keep it unchanged.'=>'Nếu bạn gặp thông báo "Rất tiếc, không còn chỗ trống" sau khi cập nhật lên phiên bản 4.3.0 trở lên, bạn có thể bật cài đặt này. Nếu không, vui lòng giữ nguyên.','If you have saved organizer details, please select the "Organizer" option. Please note that if you select "Organizer" and have not checked the organizer from the Event Organizer list on the right sidebar, the Event Location section will not populate on the front end.'=>'Nếu bạn đã lưu thông tin chi tiết về người tổ chức, vui lòng chọn tùy chọn "Người tổ chức". Xin lưu ý rằng nếu bạn chọn "Người tổ chức" và chưa kiểm tra người tổ chức từ danh sách Người tổ chức sự kiện ở thanh bên phải, phần Địa điểm sự kiện sẽ không xuất hiện ở giao diện chính.','If you reset this count, all booking information will be removed, including the attendee list. This action is irreversible, so please be sure before you proceed.'=>'Nếu bạn đặt lại số lượng này, tất cả thông tin đặt chỗ sẽ bị xóa, bao gồm cả danh sách người tham dự. Hành động này không thể đảo ngược, vì vậy hãy chắc chắn trước khi bạn tiếp tục.','If you visit attendee list menu in event section then you will see all attendee list here. You can filter choosing event name and date if event is recurring event. After filtering right section there is 2 button to export attendee and extra service.'=>'Nếu bạn truy cập menu danh sách người tham dự trong phần sự kiện thì bạn sẽ thấy tất cả danh sách người tham dự ở đây. Bạn có thể lọc bằng cách chọn tên sự kiện và ngày nếu sự kiện là sự kiện định kỳ. Sau khi lọc phần bên phải, có 2 nút để xuất người tham dự và dịch vụ bổ sung.','If you visit Event settings page then You will see PDF email tab top right, you can configure pdf email here.'=>'Nếu bạn truy cập trang Cài đặt sự kiện, bạn sẽ thấy tab Email PDF ở góc trên bên phải, bạn có thể cấu hình email PDF tại đây.','If you want to display the ticket type list with an add-to-cart button on any post or page of your website, simply copy the shortcode and paste it where desired.'=>'Nếu bạn muốn hiển thị danh sách loại vé với nút thêm vào giỏ hàng trên bất kỳ bài đăng hoặc trang nào trên trang web của mình, chỉ cần sao chép mã ngắn và dán vào nơi mong muốn.','If you want to enable event data available in the Rest API Please enable this.'=>'Nếu bạn muốn bật dữ liệu sự kiện có sẵn trong Rest API, vui lòng bật tính năng này.','If you want to hide the expired event from the calendar please select Yes. Its applicable for the Free Calendar'=>'Nếu bạn muốn ẩn sự kiện đã hết hạn khỏi lịch, vui lòng chọn Có. Điều này áp dụng cho Lịch miễn phí','If you want to show the date and time in your local timezone, please select Yes.'=>'Nếu bạn muốn hiển thị ngày và giờ theo múi giờ địa phương của mình, vui lòng chọn Có.','If you want to show the time zone with the date and time, please select "Yes".'=>'Nếu bạn muốn hiển thị múi giờ kèm theo ngày và giờ, vui lòng chọn "Có".','If you want your event to be removed from the list once it is fully booked, you can select "Yes" here.'=>'Nếu bạn muốn sự kiện của mình được xóa khỏi danh sách sau khi đã kín chỗ, bạn có thể chọn "Có" tại đây.','If you would like to hide the location details from the order details section on the thank you page and confirmation email body, please choose "Yes". If you would like to show the location details, please choose "No". The default setting is "No".'=>'Nếu bạn muốn ẩn chi tiết vị trí khỏi phần chi tiết đơn hàng trên trang cảm ơn và nội dung email xác nhận, vui lòng chọn "Có". Nếu bạn muốn hiển thị chi tiết vị trí, vui lòng chọn "Không". Cài đặt mặc định là "Không".','If your event is online or virtual, please ensure that this option is enabled.'=>'Nếu sự kiện của bạn diễn ra trực tuyến hoặc trực tuyến, vui lòng đảm bảo tùy chọn này được bật.','If your event list page is loading slowly, you can select this option to improve performance. Keep in mind that selecting this option will disable Waitlist and Seat count features. '=>'Nếu trang danh sách sự kiện của bạn tải chậm, bạn có thể chọn tùy chọn này để cải thiện hiệu suất. Lưu ý rằng việc chọn tùy chọn này sẽ vô hiệu hóa các tính năng Danh sách chờ và Số lượng chỗ ngồi.','If your theme is not loading the Owl Carousel Library, or if you"re having issues with Owl Carousel, you can set this option to "Yes" to fix the issue.'=>'Nếu chủ đề của bạn không tải được Thư viện Owl Carousel hoặc nếu bạn gặp sự cố với Owl Carousel, bạn có 